import React, { useState } from 'react';
const ComA = () => {
    const [num, setNum] = useState();
    return (
        <>
            <h1> Pokemon </h1>
            <br />
            <select value={num}
                onChange={(event) => {
                    setNum(event.target.value);
                }}>
                <option value='1'> 1 </option>
                <option value='2'> 2 </option>
                <option value='3'> 3 </option>
                <option value='4'> 4 </option>
            </select>
        </>
    );
}
export default ComA;
